import {FETCH_REPORT_BY_PLAYER_USERNAME} from './actionType'
import axios from 'axios'

const token = localStorage.getItem("userToken");
const userRegion = localStorage.getItem("userRegion")

export const fetchReportByPlayerUsername = (username) => dispatch => {
    const url = 'http://localhost:8080/api/v1/reports/players/Apolaccio?region=euw'
    axios.get(url)
        .then(res =>
            dispatch({
                type: FETCH_REPORT_BY_PLAYER_USERNAME,
                payload: res.data
            })
        );   
};
